import React from "react";
import jQuery from "jQuery";
import { render } from "react-dom";
import {
  StyleSheet,
  Text,
  View,
  SafeAreaView,
  FlatList,
  Button,
} from "react-native";

// APP

export default function App() {
  return (
    <SafeAreaView style={styles.body}>
      <View style={styles.container}>
        <Text style={styles.title}>Aplikacja Ratowników Mazowsza</Text>
        <FlatListBasics></FlatListBasics>
        <Button title="Test" onPress={test} />
      </View>
    </SafeAreaView>
  );
}

var Users = [];
fetch("http://192.168.0.27:3000/users") // ip: 192.168.0.27
  .then((response) => response.json())
  .then(function (users) {
    for (let i = 0; i < users.length; i++) {
      Users[i] = users[i];
    }
  })
  .then(function () {
    const FlatListBasics = () => {
      for (let i = 0; i < 6; i++) {}
      return (
        <View style={styles.usersList}>
          <FlatList
            data={[Users]}
            renderItem={({ item }) => (
              <View>
                {item.Name}
                {item.IsAvailable == true ? (
                  <Text style={styles.users}>
                    {item.Name} - <Text style={styles.available}>Dostępny</Text>
                  </Text>
                ) : item.IsAvailable == false ? (
                  <Text style={styles.users}>
                    {item.Name} -{""}
                    <Text style={styles.unavailable}>Niedostępny</Text>
                  </Text>
                ) : (
                  <Text style={styles.users}>
                    Błąd wczytywania użytkowników
                  </Text>
                )}
              </View>
            )}
          />
        </View>
      );
    };
    return FlatListBasics;
  });

function test() {
  console.log(Users);
